import axios from "axios"

let urlServer = 'http://localhost:8080'

export const ApiPost = async (name, email, password) => {
	const update = {
		username: toString(name),
		email: toString(email),
		password: toString(password),
	};
	const options = {
		method: 'POST',
		headers: {
			'Content-Type': 'application/json',
		},
		body: JSON.stringify(update),
	};
	console.log(options)
	let response = await axios.post(urlServer, options)
	console.log(response)
	return(response)
}
